import React from "react";

const Login = () => {
  const authorizedLogin = (e) => {
    if (!e.emailField.trim() === "" && e.passwordField.trim() === "") {
      alert("Login Success");
    } else if (e.emailField.trim() === "") {
      alert("Insert Email");
    } else {
      alert("Insert Password");
    }
  };
  return (
    <>
      <div className="res-login-container">
        <h1>Login Section</h1>
        <form>
          <label>Email or PhoneNumber</label>
          <br />
          <input
            type="text"
            placeholder="Email | PhoneNumber"
            value="emailField"
          />
          <br />
          <label>Password</label>
          <br />
          <input type="password" placeholder="Password" value="passwordField" />
          <br />
          <button onClick={() => authorizedLogin({ form })}>Login</button>
        </form>
      </div>
    </>
  );
};
export default Login;
